script: |
  super -f text -I q10760.spq | sort > q10760.out

inputs:
  - name: q10760.spq
    data: |
      SELECT ALL col0 AS col0 FROM tab2 (FORMAT parquet) WHERE NOT 11 * + - CAST ( col1 AS INTEGER ) - col2 + - col0 NOT BETWEEN + - col1 + 94 AND NULL;
  - name: tab2

outputs:
  - name: q10760.out
    data: |
